import { Component } from "react"
import Link from "next/link"

export default class Menu extends Component {
    constructor(props) {
        super(props)
    }

    render() {
        return(<ul>
            <li><Link href="/"> Home </Link></li>
            <li><Link href="/about"> About </Link></li>
        </ul>)
    }
}
